import React from 'react';
import axios from 'axios';
import { useEffect, useState } from 'react';
import { useNavigate } from "react-router-dom";

export default function SearchPatients() {
    const [listOfPatients, setListofPatients] = useState([]);
     let navigate = useNavigate(); 




    useEffect(() => {
      axios.get("http://localhost:3001/patientsinfo").then((response) => {
        setListofPatients(response.data);
      })

      axios.get("http://localhost:3001/patientsinfo").then((response) => {
        console.log(response.data.length);
      })

    }, []);
  
    return(
      <section>
          <div class="pb-4 pt-4 bg-white ">
          <label for="table-search" class="sr-only">Search</label>
          <div class="relative">
              <div class="absolute inset-y-0 rtl:inset-r-0 start-0 flex items-center ps-3 pointer-events-none">
                  <svg class="w-4 h-4 text-gray-500 dark:text-gray-400" aria-hidden="true" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 20 20">
                      <path stroke="currentColor" stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="m19 19-4-4m0-7A7 7 0 1 1 1 8a7 7 0 0 1 14 0Z"/>
                  </svg>
              </div>
              <input type="text" id="table-search" class="block pt-2 ps-10 text-sm text-gray-900 border border-gray-300 rounded-lg w-80 bg-gray-50 focus:ring-blue-500 focus:border-blue-500 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500" placeholder="Search for items"/>
          </div>
        </div>
        <table className='h-lvh w-5/6 overflow-auto table-auto border-collapse border border-slate-500'>
          <thead>
            <tr className="uppercase w-lvw border">
              <th>Id</th>
              <th>Name</th>
              <th>Sex</th>
              <th>Location</th>
              <th>PhoneNumber</th>
            </tr>
          </thead>
          <tbody>
            {listOfPatients.map((value, key) => {
              return(
                <tr onClick={() => navigate(`/patientsinfo/${value.id}`)}>
                  <td>{value.id}</td>
                  <td>{value.firstName} {value.lastName}</td>
                  <td>{value.sex}</td>
                  <td>{value.location}</td>
                  <td>{value.phoneNumber}</td>
                </tr>
              )
            })}
          </tbody>
        </table>
      </section>
     
    )
}
